import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3 5.5A2.5 2.5 0 015.5 3h9A2.5 2.5 0 0117 5.5v9a2.5 2.5 0 01-2.5 2.5h-9A2.5 2.5 0 013 14.5v-9zM4.5 7v7.5a1 1 0 001 1h9a1 1 0 001-1V7h-11z", fill: primaryFill }));
};
const WindowHeaderHorizontal20Filled = wrapIcon(rawSvg({}), 'WindowHeaderHorizontal20Filled');
export default WindowHeaderHorizontal20Filled;
